    positives = [x for x in lst if x > 0]
    return (max(negatives) if negatives else None, min(positives) if positives else None)

def compare_one(a, b):
    """Create a function that takes integers, floats, or strings representing
    real numbers, and returns the larger variable in its given variable type.
    Return None if the values are equal.
    Note: If a real number is represented as a string, the floating point might be . or ,

    compare_one(1, 2.5) ➞ 2.5
    compare_one(1, "2,3") ➞ "2,3"
    compare_one("5,1", "6") ➞ "6"
    compare_one("1", 1) ➞ None
    """
    def convert_to_float(s):
        return float(s.replace(',', '.'))

    a_float = convert_to_float(a)
    b_float = convert_to_float(b)

    if a_float > b_float:
        return a_float
    elif b_float > a_float:
        return b_float
    else:
        return None

def is_equal_to_sum_even(n):
    """Evaluate whether the given number n can be written as the sum of exactly 4 positive even numbers
    Example
    is_equal_to_sum_even(4) == False
    is_equal_to_sum_even(6) == False
    is_equal_to_sum_even(8) == True
    """
    if n % 2 != 0:
        return False
    if n < 8:
        return False
    if n == 8:
        return True
    if n % 4 == 0:
        return True
    return False

def special_factorial(n):
    result = 1
    for i in range(1, n + 1):
        result *= i
    return result

def fix_spaces(text):
    result = []
    current_space_count = 0

    for char in text:
        if char == ' ':
            current_space_count += 1
        else:
            if current_space_count > 2:
                result.append('-')
            else:
                result.append('_' * current_space_count)
            current_space_count = 0
            result.append(char)

    if current_space_count > 2:
        result.append('-')
    else:
        result.append('_' * current_space_count)

    return ''.join(result)

